import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 24, height: 24, viewBox: "0 0 24 24", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M13.38 3.03a9 9 0 11-7.9 14.1.68.68 0 01.32-1.02c3.4-1.21 5.21-2.62 6.27-4.63 1.1-2.12 1.4-4.44.62-7.62a.68.68 0 01.69-.83zm-2.39.62l.01.1V9a2 2 0 11-1.5-1.94v-2.3L6 5.83V10a2 2 0 11-1.5-1.94V5.27c0-.29.17-.55.43-.68l.1-.03 5-1.53c.45-.13.9.17.96.62z", fill: primaryFill }));
};
const Sleep24Filled = wrapIcon(rawSvg({}), 'Sleep24Filled');
export default Sleep24Filled;
